package day22_stringManipulation_Lab;

public class Strings_StartsEndWith {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		String word1 = "eclips";
		
		System.out.println(word1.startsWith("e"));
		System.out.println(word1.startsWith("ec"));
		
		System.out.println(word1.endsWith("ps"));
		System.out.println(word1.endsWith("s"));
		System.out.println(word1.endsWith("dasd"));
		
		
		
		
		
		
		
		
	}

}
